import React, { useEffect } from 'react'
import api from '../../api'
import Navbar from '../../components/navbar'

export default function Home() {

  const onLoad = () =>{
    api.get('/')
    .then((res) => {
      console.log(res.data);
    })
    .catch(err => {
      console.log(err)
    });
  }

  useEffect(() => {
    onLoad()
  }, [])
  


  return (
    <Navbar />
  )
}
